			hou_parm_template3 = new hou.StringParmTemplate({name: "soft_forward_pass_shader_unity", label: "Forward Pass Shader", num_components: 1, default_value: ["#ifndef LIGHTWEIGHT_SIMPLE_LIT_VAT_FLUID_PASS_INCLUDED\n#define LIGHTWEIGHT_SIMPLE_LIT_VAT_FLUID_PASS_INCLUDED\n\n#include \"Packages/com.unity.render-pipelines.lightweight/ShaderLibrary/Lighting.hlsl\"\n\nstruct Attributes\n{\n    float4 positionOS    : POSITION;\n    float3 normalOS      : NORMAL;\n    float4 tangentOS     : TANGENT;\n    float4 texcoord      : TEXCOORD0;\n    float4 texcoord1     : TEXCOORD1;\n    float2 lightmapUV    : TEXCOORD2;\n    float4 color         : COLOR;\n    UNITY_VERTEX_INPUT_INSTANCE_ID\n};\n\nstruct Varyings\n{\n    float4 uv                       : TEXCOORD0;\n    float4 custom                   : TEXCOORD1;\n    DECLARE_LIGHTMAP_OR_SH(lightmapUV, vertexSH, 2);\n\n    float4 posWSShininess           : TEXCOORD3;    // xyz: posWS, w: Shininess * 128\n\n#ifdef _NORMALMAP\n    half4 normal                    : TEXCOORD4;    // xyz: normal, w: viewDir.x\n    half4 tangent                   : TEXCOORD5;    // xyz: tangent, w: viewDir.y\n    half4 bitangent                 : TEXCOORD6;    // xyz: bitangent, w: viewDir.z\n#else\n    half3  normal                   : TEXCOORD4;\n    half3 viewDir                   : TEXCOORD5;\n#endif\n\n    half4 fogFactorAndVertexLight   : TEXCOORD7; // x: fogFactor, yzw: vertex light\n\n#ifdef _MAIN_LIGHT_SHADOWS\n    float4 shadowCoord              : TEXCOORD8;\n#endif\n    float4 color                    : COLOR;\n\n    float4 positionCS               : SV_POSITION;\n    UNITY_VERTEX_INPUT_INSTANCE_ID\n    UNITY_VERTEX_OUTPUT_STEREO\n};\n\n\nvoid InitializeInputData(Varyings input, half3 normalTS, out InputData inputData)\n{\n    inputData.positionWS = input.posWSShininess.xyz;\n\n#ifdef _NORMALMAP\n    half3 viewDirWS = half3(input.normal.w, input.tangent.w, input.bitangent.w);\n    inputData.normalWS = TransformTangentToWorld(normalTS,\n        half3x3(input.tangent.xyz, input.bitangent.xyz, input.normal.xyz));\n#else\n    half3 viewDirWS = input.viewDir;\n    inputData.normalWS = input.normal;\n#endif\n\n#if SHADER_HINT_NICE_QUALITY\n    viewDirWS = SafeNormalize(viewDirWS);\n#endif\n\n    inputData.normalWS = NormalizeNormalPerPixel(inputData.normalWS);\n\n    inputData.viewDirectionWS = viewDirWS;\n#if defined(_MAIN_LIGHT_SHADOWS) && !defined(_RECEIVE_SHADOWS_OFF)\n    inputData.shadowCoord = input.shadowCoord;\n#else\n    inputData.shadowCoord = float4(0, 0, 0, 0);\n#endif\n    inputData.fogCoord = input.fogFactorAndVertexLight.x;\n    inputData.vertexLighting = input.fogFactorAndVertexLight.yzw;\n    inputData.bakedGI = SAMPLE_GI(input.lightmapUV, input.vertexSH, inputData.normalWS);\n}\n\n///////////////////////////////////////////////////////////////////////////////\n//                  Vertex and Fragment functions                            //\n///////////////////////////////////////////////////////////////////////////////\n\n// Used in Standard (Simple Lighting) shader\nVaryings LitPassVertexSimple(Attributes input)\n{\n    Varyings output = (Varyings)0;\n\n    UNITY_SETUP_INSTANCE_ID(input);\n    UNITY_INITIALIZE_VERTEX_OUTPUT_STEREO(output);\n\n    //Fetch vertex position from pos and rot VAT textures\n    VATAttributes outputVAT = GetAttributesFromTexture(TEXTURE2D_ARGS(_posTex, sampler_posTex), \n                    TEXTURE2D_ARGS(_posTex2, sampler_posTex2), TEXTURE2D_ARGS(_nTex, sampler_nTex), \n                    TEXTURE2D_ARGS(_colorTex, sampler_colorTex),\n                    input.texcoord, input.texcoord1, input.color, input.positionOS, input.normalOS);\n\n    VertexPositionInputs vertexInput = GetVertexPositionInputs(outputVAT.positionVAT.xyz);\n    \n    // I\'m not modifying the tangents in the GetVertexPositionInputs function which\n    // might be a problem...\n\n    VertexNormalInputs normalInput = GetVertexNormalInputs(outputVAT.normalVAT, input.tangentOS);\n    half3 viewDirWS = GetCameraPositionWS() - vertexInput.positionWS;\n\n#if !SHADER_HINT_NICE_QUALITY\n    viewDirWS = SafeNormalize(viewDirWS);\n#endif\n\n    half3 vertexLight = VertexLighting(vertexInput.positionWS, normalInput.normalWS);\n    half fogFactor = ComputeFogFactor(vertexInput.positionCS.z);\n\n    output.uv.xy = TRANSFORM_TEX(input.texcoord, _BaseMap);\n    output.custom.xy = input.texcoord1.zw;\n\n    output.posWSShininess.xyz = vertexInput.positionWS;\n    output.posWSShininess.w = _Shininess * 128.0;\n    output.positionCS = vertexInput.positionCS;\n\n#ifdef _NORMALMAP\n    output.normal = half4(normalInput.normalWS, viewDirWS.x);\n    output.tangent = half4(normalInput.tangentWS, viewDirWS.y);\n    output.bitangent = half4(normalInput.bitangentWS, viewDirWS.z);\n#else\n    output.normal = normalInput.normalWS;\n    output.viewDir = viewDirWS;\n#endif\n    output.color = outputVAT.colorVAT;\n\n    OUTPUT_LIGHTMAP_UV(input.lightmapUV, unity_LightmapST, output.lightmapUV);\n    OUTPUT_SH(output.normal.xyz, output.vertexSH);\n\n    output.fogFactorAndVertexLight = half4(fogFactor, vertexLight);\n\n#if defined(_MAIN_LIGHT_SHADOWS) && !defined(_RECEIVE_SHADOWS_OFF)\n    output.shadowCoord = GetShadowCoord(vertexInput);\n#endif\n\n    return output;\n}\n\n// Used for StandardSimpleLighting shader\nhalf4 LitPassFragmentSimple(Varyings input) : SV_Target\n{\n    UNITY_SETUP_STEREO_EYE_INDEX_POST_VERTEX(input);\n\n    float2 uv = input.uv;\n    half4 diffuseAlpha = SampleAlbedoAlpha(uv, TEXTURE2D_ARGS(_BaseMap, sampler_BaseMap));\n    half3 diffuse = diffuseAlpha.rgb * _BaseColor.rgb * input.color.rgb;\n    // diffuse = input.color;\n    half alpha = diffuseAlpha.a * _BaseColor.a;\n\n#ifdef _ALPHAPREMULTIPLY_ON\n    diffuse *= alpha;\n#endif\n\n    half3 normalTS = SampleNormal(uv, TEXTURE2D_ARGS(_BumpMap, sampler_BumpMap));\n    half3 emission = SampleEmission(uv, _EmissionColor.rgb, TEXTURE2D_ARGS(_EmissionMap, sampler_EmissionMap));\n    // float seed = input.color.b;\n    // float bbox = input.color.a;\n    // seed = seed * 0.2 + 0.8;\n    // float rampPos = input.color.r + input.color.g;\n    // rampPos *= bbox;\n    // rampPos *= seed;\n    // rampPos /= 1.3;\n    // rampPos += input.custom.y;\n    // rampPos = clamp(rampPos, 0.01, 0.99);\n    // emission = SampleRamp(rampPos, TEXTURE2D_PARAM(_RampTex, sampler_RampTex));\n    // emission = input.color;\n    half4 specular = SampleSpecularSmoothness(uv, diffuseAlpha.a, _SpecColor, TEXTURE2D_ARGS(_SpecGlossMap, sampler_SpecGlossMap));\n    half shininess = input.posWSShininess.w;\n\n    InputData inputData;\n    InitializeInputData(input, normalTS, inputData);\n\n    half4 color = LightweightFragmentBlinnPhong(inputData, diffuse, specular, shininess, emission, alpha);\n    color.rgb = MixFog(color.rgb, inputData.fogCoord);\n    return color;\n};\n\n#endif\n"], naming_scheme: hou.parmNamingScheme.Base1, string_type: hou.stringParmType.Regular, menu_items: [], menu_labels: [], icon_names: [], item_generator_script: "", item_generator_script_language: hou.scriptLanguage.Python, menu_type: hou.menuType.Normal});
