			hou_parm_template3 = new hou.StringParmTemplate({name: "fluid_main_shader_unity", label: "Main Shader", num_components: 1, default_value: ["// Shader targeted for low end devices. Single Pass Forward Rendering.\nShader \"sidefx/lwrp/VAT Fluid Simple Lit\"\n{\n    // Keep properties of StandardSpecular shader for upgrade reasons.\n    Properties\n    {\n        //VAT Properties\n        _posMax(\"Position Max\", Float) = 1.0\n        _posMin(\"Position Min\", Float) = 1.0\n        _numOfFrames(\"Number Of Frames\", int) = 240\n        _speed(\"Speed\", Float) = 0.33\n        _doubleTex (\"Double Texture (Higher Precision)\", Float) = 0.0\n        _padPowTwo (\"Power of 2\", Float) = 0.0\n        _textureSizeX (\"Active Pixels X\", Int) = 128\n        _textureSizeY (\"Active Pixels Y\", Int) = 128\n        _paddedSizeX (\"Padded Size X\", Int) = 128\n        _paddedSizeY (\"Padded Size Y\", Int) = 128\n        _pack_normal (\"Pack Normal\", Float) = 1.0\n        _posTex (\"Position Map (RGB)\", 2D) = \"white\" {}\n        _posTex2 (\"Position Map 2 (RGB)\", 2D) = \"white\" {}\n        _nTex (\"Normal Map (RGB)\", 2D) = \"grey\" {}\n        _colorTex (\"Colour Map (RGB)\", 2D) = \"white\" {}\n\n        _BaseColor(\"Base Color\", Color) = (0.5, 0.5, 0.5, 1)\n        _BaseMap(\"Base Map (RGB) Smoothness / Alpha (A)\", 2D) = \"white\" {}\n\n        _Cutoff(\"Alpha Cutoff\", Range(0.0, 1.0)) = 0.5\n\n        _Shininess(\"Shininess\", Range(0.01, 1.0)) = 0.5\n        _GlossMapScale(\"Smoothness Factor\", Range(0.0, 1.0)) = 1.0\n\n        _Glossiness(\"Glossiness\", Range(0.0, 1.0)) = 0.5\n        [Enum(Specular Alpha,0,Albedo Alpha,1)] _SmoothnessTextureChannel(\"Smoothness texture channel\", Float) = 0\n\n        [HideInInspector] _SpecSource(\"Specular Color Source\", Float) = 0.0\n        _SpecColor(\"Specular\", Color) = (0.5, 0.5, 0.5)\n        _SpecGlossMap(\"Specular\", 2D) = \"white\" {}\n        [HideInInspector] _GlossinessSource(\"Glossiness Source\", Float) = 0.0\n        [ToggleOff] _SpecularHighlights(\"Specular Highlights\", Float) = 1.0\n        [ToggleOff] _GlossyReflections(\"Glossy Reflections\", Float) = 1.0\n\n        [HideInInspector] _BumpScale(\"Scale\", Float) = 1.0\n        [NoScaleOffset] _BumpMap(\"Normal Map\", 2D) = \"bump\" {}\n\n        _EmissionColor(\"Emission Color\", Color) = (0,0,0)\n        _EmissionMap(\"Emission\", 2D) = \"white\" {}\n\n        // Blending state\n        [HideInInspector] _Surface(\"__surface\", Float) = 0.0\n        [HideInInspector] _Blend(\"__blend\", Float) = 0.0\n        [HideInInspector] _AlphaClip(\"__clip\", Float) = 0.0\n        [HideInInspector] _SrcBlend(\"__src\", Float) = 1.0\n        [HideInInspector] _DstBlend(\"__dst\", Float) = 0.0\n        [HideInInspector] _ZWrite(\"__zw\", Float) = 1.0\n        [HideInInspector] _Cull(\"__cull\", Float) = 2.0\n\n        [ToogleOff] _ReceiveShadows(\"Receive Shadows\", Float) = 1.0\n    }\n\n    SubShader\n    {\n        Tags { \"RenderType\" = \"Opaque\" \"RenderPipeline\" = \"LightweightPipeline\" \"IgnoreProjector\" = \"True\"}\n        LOD 300\n\n        Pass\n        {\n            Name \"ForwardLit\"\n            Tags { \"LightMode\" = \"LightweightForward\" }\n\n            // Use same blending / depth states as Standard shader\n            Blend[_SrcBlend][_DstBlend]\n            ZWrite[_ZWrite]\n            Cull[_Cull]\n\n            HLSLPROGRAM\n\n            // Required to compile gles 2.0 with standard srp library\n            #pragma prefer_hlslcc gles\n            #pragma exclude_renderers d3d11_9x\n            #pragma target 2.0\n\n            // -------------------------------------\n            // Material Keywords\n            #pragma shader_feature _ALPHATEST_ON\n            #pragma shader_feature _ALPHAPREMULTIPLY_ON\n            #pragma shader_feature _ _SPECGLOSSMAP _SPECULAR_COLOR\n            #pragma shader_feature _GLOSSINESS_FROM_BASE_ALPHA\n            #pragma shader_feature _NORMALMAP\n            #pragma shader_feature _EMISSION\n            #pragma shader_feature _RECEIVE_SHADOWS_OFF\n\n            // -------------------------------------\n            // Lightweight Pipeline keywords\n            #pragma multi_compile _ _MAIN_LIGHT_SHADOWS\n            #pragma multi_compile _ _MAIN_LIGHT_SHADOWS_CASCADE\n            #pragma multi_compile _ _ADDITIONAL_LIGHTS_VERTEX _ADDITIONAL_LIGHTS\n            #pragma multi_compile _ _ADDITIONAL_LIGHT_SHADOWS\n            #pragma multi_compile _ _SHADOWS_SOFT\n            #pragma multi_compile _ _MIXED_LIGHTING_SUBTRACTIVE\n\n            // -------------------------------------\n            // Unity defined keywords\n            #pragma multi_compile _ DIRLIGHTMAP_COMBINED\n            #pragma multi_compile _ LIGHTMAP_ON\n            #pragma multi_compile_fog\n\n            //--------------------------------------\n            // GPU Instancing\n            #pragma multi_compile_instancing\n\n            #pragma vertex LitPassVertexSimple\n            #pragma fragment LitPassFragmentSimple\n            #define BUMP_SCALE_NOT_SUPPORTED 1\n\n            #include \"./SimpleLitVATFluidInput.hlsl\"\n            #include \"./SimpleLitVATFluidForwardPass.hlsl\"\n\n            ENDHLSL\n        }\n\n        Pass\n        {\n            Name \"ShadowCaster\"\n            Tags{\"LightMode\" = \"ShadowCaster\"}\n\n            ZWrite On\n            ZTest LEqual\n            Cull[_Cull]\n\n            HLSLPROGRAM\n            // Required to compile gles 2.0 with standard srp library\n            #pragma prefer_hlslcc gles\n            #pragma exclude_renderers d3d11_9x\n            #pragma target 2.0\n\n            // -------------------------------------\n            // Material Keywords\n            #pragma shader_feature _ALPHATEST_ON\n            #pragma shader_feature _GLOSSINESS_FROM_BASE_ALPHA\n\n            //--------------------------------------\n            // GPU Instancing\n            #pragma multi_compile_instancing\n\n            #pragma vertex ShadowPassVertex\n            #pragma fragment ShadowPassFragment\n\n            #include \"./SimpleLitVATFluidInput.hlsl\"\n            #include \"Packages/com.unity.render-pipelines.lightweight/Shaders/ShadowCasterPass.hlsl\"\n            ENDHLSL\n        }\n\n        Pass\n        {\n            Name \"DepthOnly\"\n            Tags{\"LightMode\" = \"DepthOnly\"}\n\n            ZWrite On\n            ColorMask 0\n            Cull[_Cull]\n\n            HLSLPROGRAM\n            // Required to compile gles 2.0 with standard srp library\n            #pragma prefer_hlslcc gles\n            #pragma exclude_renderers d3d11_9x\n            #pragma target 2.0\n\n            #pragma vertex DepthOnlyVertex\n            #pragma fragment DepthOnlyFragment\n\n            // -------------------------------------\n            // Material Keywords\n            #pragma shader_feature _ALPHATEST_ON\n            #pragma shader_feature _GLOSSINESS_FROM_BASE_ALPHA\n\n            //--------------------------------------\n            // GPU Instancing\n            #pragma multi_compile_instancing\n\n            #include \"./SimpleLitVATFluidInput.hlsl\"\n            #include \"Packages/com.unity.render-pipelines.lightweight/Shaders/DepthOnlyPass.hlsl\"\n            ENDHLSL\n        }\n\n        // This pass it not used during regular rendering, only for lightmap baking.\n        Pass\n        {\n            Name \"Meta\"\n            Tags{ \"LightMode\" = \"Meta\" }\n\n            Cull Off\n\n            HLSLPROGRAM\n            // Required to compile gles 2.0 with standard srp library\n            #pragma prefer_hlslcc gles\n            #pragma exclude_renderers d3d11_9x\n            #pragma vertex LightweightVertexMeta\n            #pragma fragment LightweightFragmentMetaSimple\n\n            #pragma shader_feature _EMISSION\n            #pragma shader_feature _SPECGLOSSMAP\n\n            #include \"./SimpleLitVATFluidInput.hlsl\"\n            #include \"Packages/com.unity.render-pipelines.lightweight/Shaders/SimpleLitMetaPass.hlsl\"\n\n            ENDHLSL\n        }\n    }\n    Fallback \"Hidden/InternalErrorShader\"\n    // CustomEditor \"UnityEditor.Experimental.Rendering.LightweightPipeline.SimpleLitShaderGUI\"\n}\n"], naming_scheme: hou.parmNamingScheme.Base1, string_type: hou.stringParmType.Regular, menu_items: [], menu_labels: [], icon_names: [], item_generator_script: "", item_generator_script_language: hou.scriptLanguage.Python, menu_type: hou.menuType.Normal});
